import React from 'react';
import ReactPlayer from "react-player";
import logo from './Assets/logo.svg';
import twitter from './Assets/twitter.svg';
import linkedin from './Assets/linkedin.svg';
import email from './Assets/email.svg';
import Carousel from './carousel';
import './App.css';
//make the carosel its own component and set autoplay to true
//make map it's own componen as well.


function App() {
  return (
    <div>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p className="App-desc">
          Using human experts, product data, and AI, our <br/>
          tech enables retailers to empower and guide <br/>
          their consumers towards making more sustainable choices.
        </p>
      </header>
        <body className="App-body">
        <div>
        <Carousel/>
        </div>
        <div>
            <p className="App-desc">Redare’s founders are passionate that products valued and purchased by consumers and <br/>
            retailers for being “sustainable” should make differences at scale to people and planet.</p>
            <p>Given the importance of demand-side intervention, Redare has a long-term vision for using core sustainability data and its ranking <br/>
            engine, as well as gamification, consumer psychology and food informatics. Integrating Redare with online retail environments <br/>
            offers opportunities for tracking individual customers, rewards for footprint reduction, gamification of customer nudging, and <br/>
            education. We envision a possibilities to create engagement with consumers through retailers and directly with the Redare app <br/>
                    once core trust and relationships are built.</p>
        </div>

        <div>
            //team with map and lines
        </div>
        </body>
        <footer className="App-footer">

            <text className="Footer-text">© 2020, Redare AB </text>

            <div className="Footer-icons">
            <img src={twitter} className="Footer-twitter" alt="twitter"/>
            <img src={linkedin} className="Footer-linkedin" alt="linkedin"/>
            <img src={email} className="Footer-email" alt="email"/>
            </div>
        </footer>
    </div>

  );
}

export default App;
